import "./App.css";
import { Header } from "./components/Header";
import { Footer } from "./components/Footer";
import { Outlet } from "react-router-dom";
import toast, {Toaster} from 'react-hot-toast'
function App() {
  return (
    <>
    <Toaster/>
    <div className="App">
      <Header />
      <main className="pt-24 bg-slate-100 min-h-[calc(100vh)]">
        <Outlet />
      </main>
    </div>
    </>
  );
}

export default App;
